        'mobileworkarea_10': 'CAN_Login_mobileworkarea_10',
        'mobileimage_3': 'CAN_Login_mobileimage_3',
        'spacer_4': 'CAN_Login_spacer_4',
        'mobilebutton_5': 'CAN_Login_mobilebutton_5',
